import React from "react";

function Footer() {
  return (
    <div className="header">
      <img
        src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.iamthecode.org%2Fsteamd_marketplace%2Fwhat-is-code%2F&psig=AOvVaw0xjeiDgTt6iIclvmL33c08&ust=1691494206153000&source=images&cd=vfe&opi=89978449&ved=0CBEQjRxqFwoTCLiNk4y5yoADFQAAAAAdAAAAABAE"
        alt="Footer Image"
      />
    </div>
  );
}

export default Footer;
